<template>
  <div style="height: 100%">
    <div><search-bar @onSearch="getData" ref="searchBar"></search-bar></div>
    <div id="wordcloud" :style="{width: '100%', height: '100%'}" :data="worddata"></div>
  </div>
</template>

<script>
import SearchBar from '../basic/SearchBar'
export default {
  name: 'Portrait',
  components: {SearchBar},
  data () {
    return {
      worddata: ''
    }
  },
  mounted: function () {
    // this.initChart()
  },

  methods: {
    initChart () {
      this.chart = this.$echarts.init(document.getElementById('wordcloud'))
      let image = 'data:image/png;base64,'
      // let image = 'data:image/png;base64,'
      // let image = 'data:image/png;base64,'
      const maskResource = new Image()
      maskResource.src = image
      const option = {
        backgroundColor: '#fff',
        tooltip: {
          pointFormat: '{series.name}: <b>{point.percentage:.1f}%</b>'
        },
        series: [
          {
            type: 'wordCloud',
            maskImage: maskResource,
            // 用来调整词之间的距离
            gridSize: 10,
            // 用来调整字的大小范围
            // Text size range which the value in data will be mapped to.
            // Default to have minimum 12px and maximum 60px size.
            sizeRange: [14, 60],
            // Text rotation range and step in degree. Text will be rotated randomly in range [-90,                                                                             90] by rotationStep 45
            // 用来调整词的旋转方向，，[0,0]--代表着没有角度，也就是词为水平方向，需要设置角度参考注释内容
            rotationRange: [-45, 0, 45, 90],
            // rotationRange: [ 0,90],
            // rotationRange: [0, 0],
            // 随机生成字体颜色
            textStyle: {
              fontFamily: 'sans-serif',
              fontWeight: 'bold',
              // Color can be a callback function or a color string
              color: function () {
                // Random color
                return 'rgb(' + [
                  Math.round(Math.random() * 160),
                  Math.round(Math.random() * 160),
                  Math.round(Math.random() * 160)
                ].join(',') + ')'
              }
            },
            // 位置相关设置
            // Folllowing left/top/width/height/right/bottom are used for positioning the word cloud
            // Default to be put in the center and has 75% x 80% size.
            left: 'center',
            top: 'center',
            right: null,
            bottom: null,
            width: '80%',
            height: '100%',
            // 数据
            data: this.worddata
          }
        ]
      }
      this.chart.setOption(option)
      window.onresize = this.chart.resize
    },
    getData () {
      this.$axios.get('/portrait/' + this.$refs.searchBar.keywords + '/').then(resp => {
        if (resp.status === 200) {
          this.worddata = resp.data.data
          // console.log(resp)
          console.log(this.worddata)
          this.initChart()
        }
      }).catch(failResponse => {
        this.$message('加载失败')
      })
    }
  }

}
</script>

